import React, { Component } from 'react';
import Timeline from './Timeline';
import App from './App';
import Comment from './Comment';

class Post extends Component {
  constructor(props) {
    super(props);
  }

  render() {
    return (
      <div>
        <div className='post-container'>
          <div className='post-top-container'>
            <img src={this.props.userImage} alt="prfl"/>

            <div className='post-user-info'>
              <h4>{this.props.currentUser.belongsTo}</h4>
              <h4>Time</h4>
            </div>

            <div className='post-top-msg'>
              <p>{this.props.formContent}</p>
            </div>
          </div>
              
          <div className='post-interaction-box'>
            <p>{this.props.likeAmount} Likes {this.props.commentsAmount} Comments</p>
            <button type='button'>Like</button>
            <button type='button'>Comment</button>
          </div>
        </div>
      </div>
    )
  }
}

export default Post;
